import React from "react";
import "./styles.css";

const Footer = () => {
  return (
    <footer className="footer">
      <div>
        <div>
          <h1> About </h1>
        </div>
        <div>
          <h1> Who Made This?</h1>
        </div>
        <div>
          <h1> Where Can You Find Me?</h1>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
